import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import 'bootstrap/dist/css/bootstrap.min.css';

import AllCourses from "./AllCourses";


ReactDOM.render(
  <React.StrictMode>
    <AllCourses />
  </React.StrictMode>,
  document.getElementById('root')
);

